fieldset/DIAGIFRST:
  description: Diagnostic Interface Reset Register.
  fields:
  - name: ASSERTIFRST
    description: Writing a 1 will synchronously clear the Diagnostic Interface. The STICKY bits for status and well as the PARFV will be cleared. If a true functional failure still exists, the interface will re-assert FUNCFAIL on the cycle following the interface reset.
    bit_offset: 0
    bit_size: 1
